//           '<html><head><meta http-equiv="Content-Type" content="text/html; charset=utf-8"><meta name="Generator" content="Microsoft Word 15 (filtered medium)"><style><!--@font-face{font-family:"Cambria Math"}@font-face{font-family:Calibri}@font-face{font-family:"Calibri Light"}@font-face{font-family:Lato}p.MsoNormal, li.MsoNormal, div.MsoNormal{margin:0in;font-size:11.0pt;font-family:"Calibri",sans-serif}h2{margin-right:0in;margin-left:0in;font-size:18.0pt;font-family:"Calibri",sans-serif;font-weight:bold}a:link, span.MsoHyperlink{color:blue;text-decoration:underline}span.contentpasted0{}span.xxelementtoproof{}span.Heading2Char{font-family:"Calibri Light",sans-serif;color:#2F5496}p.xxxmsonormal, li.xxxmsonormal, div.xxxmsonormal{margin:0in;font-size:11.0pt;font-family:"Calibri",sans-serif}span.xxxfluidplugincopy{}span.xxxcontentpasted0{}span.EmailStyle32{font-family:"Calibri",sans-serif;color:windowtext}.MsoChpDefault{font-size:10.0pt}@page WordSection1{margin:1.0in 1.0in 1.0in 1.0in}div.WordSection1{}--></style></head><body lang="EN-US" link="blue" vlink="purple" style="word-wrap:break-word"><div class="WordSection1"><p class="MsoNormal">Ginkgo did not say anything about being a finalist in their communications with me but it is a Zoom call with Angela Perkins, one of the talent leads(if that means anything in particular). Thanks so much for the tips. I have until next Tuesday to prepare.</p><p class="MsoNormal">&nbsp;</p><p class="MsoNormal">-Olivier </p><p class="MsoNormal">&nbsp;</p><div style="border:none; border-top:solid #B5C4DF 1.0pt; padding:3.0pt 0in 0in 0in"><p class="MsoNormal"><b><span style="font-size:12.0pt; color:black">From: </span></b><span style="font-size:12.0pt; color:black">Victory M Yinka-Banjo &lt;vybanjo@mit.edu&gt;<br><b>Date: </b>Wednesday, January 18, 2023 at 12:24 PM<br><b>To: </b>Olivier Lafontant-Joseph &lt;olivj23@mit.edu&gt;<br><b>Subject: </b>Re: Preview - Ginkgo Cultivate Fellowship! Redressing Black students\' historic marginalization. Learn more and apply!</span></p></div><div><p class="MsoNormal">&nbsp;</p></div><div><p class="MsoNormal"><span style="font-size:12.0pt; color:black; background:white">Hey Olivier!</span></p></div><div><p class="MsoNormal">&nbsp;</p></div><div><p class="MsoNormal"><span style="font-size:12.0pt; color:black; background:white">I\'m so glad to hear you applied and have an interview. Did they specify if this would be a video call interview? For my year, I think only finalists were invited for a video interview but there was no initial phone pre-screen apart from that. So, it was just that one interview. It might be different this year though.&nbsp;</span></p></div><div><p class="MsoNormal">&nbsp;</p></div><div><p class="MsoNormal"><span style="font-size:12.0pt; color:black; background:white">That said, t</span><span class="contentpasted0"><span style="font-size:11.5pt; font-family:&quot;Arial&quot;,sans-serif; color:black; background:white">he interview is pretty chill and is purely behavioral. They don\'t expect you to know anything about biology/biotech.</span></span></p></div><div><p class="MsoNormal"><span style="font-size:11.5pt; font-family:&quot;Arial&quot;,sans-serif; color:#1D1C1D; background:#F8F8F8"><br><br></span></p></div><div><p class="MsoNormal"><span class="contentpasted0"><span style="font-size:11.5pt; font-family:&quot;Arial&quot;,sans-serif; color:black; background:white">The main thing I\'d say they look out for is curiosity. Probably about half of the people in my cohort were pure CS majors (no affiliation to biotech) but they\'re actively looking for students in CS that they can sort of steal/convince to end up in biotech so that\'d prob be a plus for you since you\'re 6-7! But yeah, practicing (typical behavioral) questions like &quot;talk about an obstacle and how you overcame it&quot; or &quot;what do you look out for in a mentorship relationship&quot; might help. Those are the Qs I remember being asked.</span></span></p></div><div><p class="MsoNormal"><span class="contentpasted0"><span style="font-size:11.5pt; font-family:&quot;Arial&quot;,sans-serif; color:black; background:white">Umm, other than that, maybe just knowing a bit about what Ginkgo does by glancing through the site. Also, def ask questions about ginkgo cuz it\'s sort of hard to know what they do just by reading the website.In general, just be yourself and allow your personality to shine through. Don\'t brag but also be ready to talk about things in your resume/ humbly sell yourself. Also go over your essay(s) if you can;&nbsp; wasn\'t asked anything from mine but they may pull stuff from there.</span></span></p></div><div><p class="MsoNormal"><span style="font-size:11.5pt; font-family:&quot;Arial&quot;,sans-serif; color:#1D1C1D; background:white"><br><br></span></p></div><div><p class="MsoNormal"><span class="contentpasted0"><span style="font-size:11.5pt; font-family:&quot;Arial&quot;,sans-serif; color:black; background:white">Hope this helps and all the best!</span></span></p></div><div><p class="MsoNormal"><span style="font-size:11.5pt; font-family:&quot;Arial&quot;,sans-serif; color:black; background:white"><br><br></span></p></div><div><p class="MsoNormal"><span class="contentpasted0"><span style="font-size:11.5pt; font-family:&quot;Arial&quot;,sans-serif; color:black; background:white">~ Victory&nbsp;</span></span></p></div><div class="MsoNormal" align="center" style="text-align:center"><hr size="0" width="100%" align="center"></div><div id="divRplyFwdMsg"><p class="MsoNormal"><b><span style="color:black">From:</span></b><span style="color:black"> Olivier Lafontant-Joseph &lt;olivj23@mit.edu&gt;<br><b>Sent:</b> Tuesday, January 17, 2023 4:22 PM<br><b>To:</b> Victory M Yinka-Banjo &lt;vybanjo@mit.edu&gt;<br><b>Subject:</b> Re: Preview - Ginkgo Cultivate Fellowship! Redressing Black students\' historic marginalization. Learn more and apply!</span> </p><div><p class="MsoNormal">&nbsp;</p></div></div><div><div><div><div><p class="MsoNormal">Hi,</p></div><div><p class="MsoNormal">&nbsp;</p></div><div><p class="MsoNormal">Hope your IAP has been going well. I got invited for a phone screen from Ginkgo. Did you have a phone screen when you applied? What was it like? If you still remember what questions they asked, I would be super grateful if you could share some of them with me.</p></div><div><p class="MsoNormal">&nbsp;</p></div><div><p class="MsoNormal">-Olivier</p></div><div><p class="MsoNormal">&nbsp;</p></div><div id="x_ms-outlook-mobile-signature"><div><p class="MsoNormal">&nbsp;</p></div></div></div></div><div class="MsoNormal" align="center" style="text-align:center"><hr size="0" width="100%" align="center"></div><div id="x_divRplyFwdMsg"><p class="MsoNormal"><b><span style="color:black">From:</span></b><span style="color:black"> Victory M Yinka-Banjo &lt;vybanjo@mit.edu&gt;<br><b>Sent:</b> Sunday, January 1, 2023 10:56:30 AM<br><b>To:</b> Olivier Lafontant-Joseph &lt;olivj23@mit.edu&gt;<br><b>Subject:</b> Re: Preview - Ginkgo Cultivate Fellowship! Redressing Black students\' historic marginalization. Learn more and apply!</span> </p><div><p class="MsoNormal">&nbsp;</p></div></div><div><div><p class="MsoNormal"><span class="xxelementtoproof"><span style="font-size:12.0pt; color:black; background:white">Hey Olivier!</span></span></p></div><div><p class="MsoNormal">&nbsp;</p></div><div><p class="MsoNormal"><span class="xxelementtoproof"><span style="font-size:12.0pt; color:black; background:white">Happy new year!!&nbsp;</span></span></p></div><div><p class="MsoNormal">&nbsp;</p></div><div><p class="MsoNormal"><span class="xxelementtoproof"><span style="font-size:12.0pt; color:black; background:white">I\'m so sorry for the late response but yes, I did like visiting Ginkgo a lot, especially the people! Most people who work there are pretty young and down-to-earth; we also went bowling with them so that was a nice to break the ice and get to know them better. As a Cultivate Fellow, you don\'t work on actual projects at Ginkgo, but you do learn about them and what it is they do as a company. I\'d definitely say that the projects we were introduced to were super interesting. We did a little bit of wet lab stuff at Ginkgo and also toured the facilities and had panels with different departments, ranging from foundry (wet labs) to bioinformatics/software groups!&nbsp;</span></span></p></div><div><p class="MsoNormal">&nbsp;</p></div><div><p class="MsoNormal"><span class="xxelementtoproof"><span style="font-size:12.0pt; color:black; background:white">Also, something that is pretty cool about the fellowship is that they also do their best to expose students to things outside of Ginkgo, so just general career paths in STEM in general. For instance, we went to Harvard Med School and practice delivering dummy babies and also suturing skin. We met some members of the US-CORPS and biotechnology patent agents as a law firm as well. I didn\'t find the CORPS or suturing interesting tbh but it was still cool to learn about. We also did a lot of fun stuff! Like going bowling, touring Boston, and were fed sooo much lol.&nbsp;</span></span></p></div><div><p class="MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">&nbsp;</span></p></div><div><p class="MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">Okay, that\'s all I can think of but yeah, it\'s def a great opportunity, especially with the associated stipend so I would encourage anyone to apply. Good luck with your app!</span></p></div><div><p class="MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">&nbsp;</span></p></div><div><p class="MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">Best,&nbsp;</span></p></div><div><p class="MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">Victory</span></p></div><div class="MsoNormal" align="center" style="text-align:center"><hr size="0" width="100%" align="center"></div><div id="x_x_divRplyFwdMsg"><p class="MsoNormal"><b><span style="color:black">From:</span></b><span style="color:black"> Olivier Lafontant-Joseph &lt;olivj23@mit.edu&gt;<br><b>Sent:</b> Saturday, December 17, 2022 7:43 PM<br><b>To:</b> Victory M Yinka-Banjo &lt;vybanjo@mit.edu&gt;<br><b>Subject:</b> Re: Preview - Ginkgo Cultivate Fellowship! Redressing Black students\' historic marginalization. Learn more and apply!</span> </p><div><p class="MsoNormal">&nbsp;</p></div></div><div><div><p class="xxxmsonormal">Hi Victory,</p><p class="xxxmsonormal">&nbsp;</p><p class="xxxmsonormal">Thanks. Yeah, I saw this advertised by NSBE. I am going to apply for it. I just need to write the 300-word application essay. Did you like what Ginkgo had to offer when you visited? Were the people nice? Are the projects interesting?</p><p class="xxxmsonormal">&nbsp;</p><p class="xxxmsonormal">-Olivier</p><p class="xxxmsonormal">&nbsp;</p><div style="border:none; border-top:solid #B5C4DF 1.0pt; padding:3.0pt 0in 0in 0in"><p class="xxxmsonormal"><b><span style="font-size:12.0pt; color:black">From: </span></b><span style="font-size:12.0pt; color:black">Victory M Yinka-Banjo &lt;vybanjo@mit.edu&gt;<br><b>Date: </b>Saturday, December 17, 2022 at 1:52 PM<br><b>To: </b>Olivier Lafontant-Joseph &lt;olivj23@mit.edu&gt;<br><b>Subject: </b>Fw: Preview - Ginkgo Cultivate Fellowship! Redressing Black students\' historic marginalization. Learn more and apply!</span></p></div><div><p class="xxxmsonormal">&nbsp;</p></div><div><p class="xxxmsonormal"><span class="xxxfluidplugincopy"><span style="font-size:12.0pt; color:black; background:white">Hey Olivier!</span></span> </p><div><p class="xxxmsonormal" style="background:white"><span style="font-size:12.0pt; color:black">&nbsp;</span></p></div><div><p class="xxxmsonormal" style="background:white"><span style="font-size:12.0pt; color:black">This is something you might be interested in.&nbsp;</span></p></div><div><p class="xxxmsonormal" style="background:white"><span style="font-size:12.0pt; color:black">&nbsp;</span></p></div><div><p class="xxxmsonormal" style="background:white"><span class="xxxfluidplugincopy"><span style="font-size:12.0pt; color:black; background:white">The applications for the 2<sup>nd</sup>&nbsp;cohort are now open and close at the end of January</span></span><span class="xxxcontentpasted0"><span style="font-size:12.0pt; color:black; background:white">&nbsp;</span></span><span class="xxxfluidplugincopy"><b><span style="font-size:12.0pt; color:black; background:white">(the 31st)</span></b></span><span class="xxxfluidplugincopy"><span style="font-size:12.0pt; color:black; background:white">. I was a part of the first cohort, and we were about 12 students! Ginkgo is actively looking for ways to expose people within and outside of bio to what they do, especially because they are breaking into a lot of robotics and computational spaces in their offices.</span></span><span class="xxxcontentpasted0"><span style="font-size:12.0pt; color:black; background:white">&nbsp;</span></span><span class="xxxfluidplugincopy"><b><span style="font-size:12.0pt; color:black; background:white">The fellowship is 4 years long and comes with a $3000</span></b></span><span class="xxxcontentpasted0"><span style="font-size:12.0pt; color:black; background:white">&nbsp;</span></span><span class="xxxfluidplugincopy"><span style="font-size:12.0pt; color:black; background:white">annual scholarship + a weeklong all-expenses-paid trip (over the summer) to Boston to explore what they do as a company.&nbsp;</span></span></p></div><div><div><p class="xxxmsonormal" style="background:white"><span style="font-size:12.0pt; color:black">&nbsp;</span></p></div><div><p class="xxxmsonormal" style="background:white"><b><span style="font-size:12.0pt; color:black">It is specifically for students who identify as black.&nbsp;</span></b></p></div><div><p class="xxxmsonormal" style="background:white"><span style="font-size:12.0pt; color:black">&nbsp;</span></p></div><div><p class="xxxmsonormal" style="background:white"><span style="font-size:12.0pt; color:black">Best,&nbsp;</span></p></div></div><div><p class="xxxmsonormal" style="background:white"><span class="xxxfluidplugincopy"><span style="font-size:12.0pt; color:black; background:white">Victory</span></span></p></div><p class="xxxmsonormal">&nbsp;</p></div><div><div><div><p class="xxxmsonormal">&nbsp;</p><div><div><p class="xxxmsonormal">&nbsp;</p></div><p class="xxxmsonormal" style="margin-bottom:12.0pt">&nbsp;</p><div><div><div><table class="MsoNormalTable" border="0" cellspacing="0" cellpadding="0" width="100%" style="width:100.0%; border-collapse:collapse"><tbody><tr><td valign="top" style="padding:0in 0in 0in 0in"><div id="x_x_x_x_m_-2133782176778141572hs_cos_wrapper_main"><div id="x_x_x_x_m_-2133782176778141572section_1663686610065"><div><div id="x_x_x_x_m_-2133782176778141572column_1663686610065_0"><div id="x_x_x_x_m_-2133782176778141572hs_cos_wrapper_module_16636866100453"><table class="MsoNormalTable" border="0" cellspacing="0" cellpadding="0" width="100%" style="width:100.0%; border-collapse:collapse"><tbody><tr><td valign="top" style="padding:7.5pt 15.0pt 7.5pt 15.0pt"><p class="xxxmsonormal" align="center" style="text-align:center"><span style="font-size:1.0pt; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; border:solid windowtext 1.0pt; padding:0in"><img width="560" height="560" id="x_x_x__x005f_x0000_i1034" src="cid:~WRD0000.jpg" alt="Image removed by sender. Sec 1 - Header banner - 700X200 (4)" style="width:5.8333in; height:5.8333in"></span></p></td></tr></tbody></table></div><table class="MsoNormalTable" border="0" cellspacing="0" cellpadding="0" width="100%" style="width:100.0%; border-collapse:collapse"><tbody><tr><td style="padding:7.5pt 15.0pt 7.5pt 15.0pt"><div id="x_x_x_x_m_-2133782176778141572hs_cos_wrapper_module_16636866744102"><div id="x_x_x_x_m_-2133782176778141572hs_cos_wrapper_module_16636866744102_"><blockquote style="margin-top:5.0pt; margin-bottom:5.0pt"><h2 style="margin:0in; line-height:150%"><span style="font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">Building a more equitable company, technology,&nbsp;and society</span></h2><p style="line-height:125%"><span style="font-size:12.0pt; line-height:125%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">&nbsp;</span></p><h2 style="margin:0in; line-height:150%"><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal">At </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">Ginkgo</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal">, we\'re </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">committed to</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal"> building a more </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">equitable</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal"> </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">company</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal">, </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">technology</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal">, and </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">society</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal">. To fulfill <a href="https://cG1Zb04.na1.hubspotlinks.com/Ctc/DL+113/cG1Zb04/VX8B6T6Y-FC6W4ySygB21p1f_W8kTzPf4TF0rSN8_nRGw3q90pV1-WJV7CgFj8W63BHJd2tdJZYW8XNBNg6ZvjY0W14WCZG7C3FyqVr-jd_3CGl8NW6vfFWl6MdXPrW1kVmLS8RFDtqW2Lzxrk22sxbmW395jk87zVxP6W22JxHZ1cb-q7W4d_bWv1_Xs0DW3-Gmpw4Cvvk0N3k5R8yxy-s1W5XHVxQ2BS6xMW7_s1MP1XmTjLW1d5ZtX6P9459W8nKJZk3F4d5fW3h9Z801rKyknW6cnFWB2n0VDDW87G_BF3cw7mkW314Np041wbXXN1_pw8Q7w-g2W8V3J8G961YllW7McGYy2YbHdtW19xNDp3HjlwCW5bWnNf6JryqdW7qVqT-5m3ZmN3bgT1"><b><span style="color:#3574E3">this</span></b></a> commitment, we established the Cultivate Fellowship to combat the historical marginalization of Black students in STEM and to provide networking and support for Black students in these fields.</span></h2></blockquote></div></div></td></tr></tbody></table><div id="x_x_x_x_m_-2133782176778141572hs_cos_wrapper_module_16686338026521"><p class="xxxmsonormal" style="background:white"><span style="font-size:13.5pt; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">&nbsp;</span></p><table class="MsoNormalTable" border="0" cellspacing="0" cellpadding="0" width="100%" style="width:100.0%; border-collapse:collapse; border-spacing:0!important"><tbody><tr><td valign="top" style="padding:7.5pt 15.0pt 7.5pt 15.0pt; word-break:break-word"><p class="xxxmsonormal" align="center" style="text-align:center"><span style="font-size:1.0pt; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; border:solid windowtext 1.0pt; padding:0in"><img border="0" width="560" height="560" id="x_x_x__x005f_x0000_i1033" src="cid:~WRD0000.jpg" alt="Image removed by sender. Sec 3 - 700X350 (1)" style="width:5.8333in; height:5.8333in"></span></p></td></tr></tbody></table></div><table class="MsoNormalTable" border="0" cellspacing="0" cellpadding="0" width="100%" style="width:100.0%; border-collapse:collapse"><tbody><tr><td style="paddin