//           '<html><head><meta http-equiv="Content-Type" content="text/html; charset=utf-8"></head><body><div dir="ltr"><div></div><div><div dir="ltr">Hi,</div><div dir="ltr"><br></div><div dir="ltr">Hope your IAP has been going well. I got invited for a phone screen from Ginkgo. Did you have a phone screen when you applied? What was it like? If you still remember what questions they asked, I would be super grateful if you could share some of them with me.<span></span><span></span></div><div dir="ltr"><br></div><div dir="ltr">-Olivier</div><div dir="ltr"><br></div><div id="ms-outlook-mobile-signature" dir="ltr"><div dir="ltr"><br></div></div></div></div><hr tabindex="-1" style="display:inline-block; width:98%"><div id="divRplyFwdMsg" dir="ltr"><font face="Calibri, sans-serif" color="#000000" style="font-size:11pt"><b>From:</b> Victory M Yinka-Banjo &lt;vybanjo@mit.edu&gt;<br><b>Sent:</b> Sunday, January 1, 2023 10:56:30 AM<br><b>To:</b> Olivier Lafontant-Joseph &lt;olivj23@mit.edu&gt;<br><b>Subject:</b> Re: Preview - Ginkgo Cultivate Fellowship! Redressing Black students\' historic marginalization. Learn more and apply!</font> <div>&nbsp;</div></div><style type="text/css" style="display:none"><!--p{margin-top:0;margin-bottom:0}--></style><div dir="ltr"><div class="x_elementToProof"><span class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)">Hey Olivier!</span></div><div class="x_elementToProof"><span class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)"><br></span></div><div class="x_elementToProof"><span class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)">Happy new year!!&nbsp;</span></div><div class="x_elementToProof"><span class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)"><br></span></div><div class="x_elementToProof"><span class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)">I\'m so sorry for the late response but yes, I did like visiting Ginkgo a lot, especially the people! Most people who work there are pretty young and down-to-earth; we also went bowling with them so that was a nice to break the ice and get to know them better. As a Cultivate Fellow, you don\'t work on actual projects at Ginkgo, but you do learn about them and what it is they do as a company. I\'d definitely say that the projects we were introduced to were super interesting. We did a little bit of wet lab stuff at Ginkgo and also toured the facilities and had panels with different departments, ranging from foundry (wet labs) to bioinformatics/software groups!&nbsp;</span></div><div class="x_elementToProof"><span class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)"><br></span></div><div class="x_elementToProof"><span class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)">Also, something that is pretty cool about the fellowship is that they also do their best to expose students to things outside of Ginkgo, so just general career paths in STEM in general. For instance, we went to Harvard Med School and practice delivering dummy babies and also suturing skin. We met some members of the US-CORPS and biotechnology patent agents as a law firm as well. I didn\'t find the CORPS or suturing interesting tbh but it was still cool to learn about. We also did a lot of fun stuff! Like going bowling, touring Boston, and were fed sooo much lol.&nbsp;</span></div><div class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)"><br></div><div class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)">Okay, that\'s all I can think of but yeah, it\'s def a great opportunity, especially with the associated stipend so I would encourage anyone to apply. Good luck with your app!</div><div class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)"><br></div><div class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)">Best,&nbsp;</div><div class="x_elementToProof" style="font-family:Calibri,Arial,Helvetica,sans-serif; font-size:12pt; color:rgb(0,0,0); background-color:rgb(255,255,255)">Victory</div><div id="x_appendonsend"></div><hr tabindex="-1" style="display:inline-block; width:98%"><div id="x_divRplyFwdMsg" dir="ltr"><font face="Calibri, sans-serif" color="#000000" style="font-size:11pt"><b>From:</b> Olivier Lafontant-Joseph &lt;olivj23@mit.edu&gt;<br><b>Sent:</b> Saturday, December 17, 2022 7:43 PM<br><b>To:</b> Victory M Yinka-Banjo &lt;vybanjo@mit.edu&gt;<br><b>Subject:</b> Re: Preview - Ginkgo Cultivate Fellowship! Redressing Black students\' historic marginalization. Learn more and apply!</font> <div>&nbsp;</div></div><style><!--@font-face{font-family:"Cambria Math"}@font-face{font-family:Calibri}@font-face{font-family:Lato}p.x_x_MsoNormal, li.x_x_MsoNormal, div.x_x_MsoNormal{margin:0in;font-size:11.0pt;font-family:"Calibri",sans-serif}h2{margin-right:0in;margin-left:0in;font-size:18.0pt;font-family:"Calibri",sans-serif;font-weight:bold}a:link, span.x_x_MsoHyperlink{color:blue;text-decoration:underline}span.x_x_Heading2Char{font-family:"Calibri Light";color:#2F5496}span.x_x_EmailStyle24{font-family:"Calibri",sans-serif;color:windowtext}.x_x_MsoChpDefault{font-size:10.0pt}@page WordSection1{margin:1.0in 1.0in 1.0in 1.0in}--></style><div lang="EN-US" style="word-wrap:break-word"><div class="x_x_WordSection1"><p class="x_x_MsoNormal">Hi Victory,</p><p class="x_x_MsoNormal">&nbsp;</p><p class="x_x_MsoNormal">Thanks. Yeah, I saw this advertised by NSBE. I am going to apply for it. I just need to write the 300-word application essay. Did you like what Ginkgo had to offer when you visited? Were the people nice? Are the projects interesting?</p><p class="x_x_MsoNormal">&nbsp;</p><p class="x_x_MsoNormal">-Olivier</p><p class="x_x_MsoNormal">&nbsp;</p><div style="border:none; border-top:solid #B5C4DF 1.0pt; padding:3.0pt 0in 0in 0in"><p class="x_x_MsoNormal"><b><span style="font-size:12.0pt; color:black">From: </span></b><span style="font-size:12.0pt; color:black">Victory M Yinka-Banjo &lt;vybanjo@mit.edu&gt;<br><b>Date: </b>Saturday, December 17, 2022 at 1:52 PM<br><b>To: </b>Olivier Lafontant-Joseph &lt;olivj23@mit.edu&gt;<br><b>Subject: </b>Fw: Preview - Ginkgo Cultivate Fellowship! Redressing Black students\' historic marginalization. Learn more and apply!</span></p></div><div><p class="x_x_MsoNormal">&nbsp;</p></div><div><p class="x_x_MsoNormal"><span class="x_x_fluidplugincopy"><span style="font-size:12.0pt; color:black; background:white">Hey Olivier!</span></span> </p><div><p class="x_x_MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">&nbsp;</span></p></div><div><p class="x_x_MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">This is something you might be interested in.&nbsp;</span></p></div><div><p class="x_x_MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">&nbsp;</span></p></div><div><p class="x_x_MsoNormal" style="background:white"><span class="x_x_fluidplugincopy"><span style="font-size:12.0pt; color:black; background:white">The applications for the 2<sup>nd</sup>&nbsp;cohort are now open and close at the end of January</span></span><span class="x_x_contentpasted0"><span style="font-size:12.0pt; color:black; background:white">&nbsp;</span></span><span class="x_x_fluidplugincopy"><b><span style="font-size:12.0pt; color:black; background:white">(the 31st)</span></b></span><span class="x_x_fluidplugincopy"><span style="font-size:12.0pt; color:black; background:white">. I was a part of the first cohort, and we were about 12 students! Ginkgo is actively looking for ways to expose people within and outside of bio to what they do, especially because they are breaking into a lot of robotics and computational spaces in their offices.</span></span><span class="x_x_contentpasted0"><span style="font-size:12.0pt; color:black; background:white">&nbsp;</span></span><span class="x_x_fluidplugincopy"><b><span style="font-size:12.0pt; color:black; background:white">The fellowship is 4 years long and comes with a $3000</span></b></span><span class="x_x_contentpasted0"><span style="font-size:12.0pt; color:black; background:white">&nbsp;</span></span><span class="x_x_fluidplugincopy"><span style="font-size:12.0pt; color:black; background:white">annual scholarship + a weeklong all-expenses-paid trip (over the summer) to Boston to explore what they do as a company.&nbsp;</span></span><span style="font-size:12.0pt; color:black"></span></p></div><div><div><p class="x_x_MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">&nbsp;</span></p></div><div><p class="x_x_MsoNormal" style="background:white"><b><span style="font-size:12.0pt; color:black">It is specifically for students who identify as black.&nbsp;</span></b><span style="font-size:12.0pt; color:black"></span></p></div><div><p class="x_x_MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">&nbsp;</span></p></div><div><p class="x_x_MsoNormal" style="background:white"><span style="font-size:12.0pt; color:black">Best,&nbsp;</span></p></div></div><div><p class="x_x_MsoNormal" style="background:white"><span class="x_x_fluidplugincopy"><span style="font-size:12.0pt; color:black; background:white">Victory</span></span><span style="font-size:12.0pt; color:black"></span></p></div><p class="x_x_MsoNormal">&nbsp;</p></div><div><div><div><p class="x_x_MsoNormal">&nbsp;</p><div><div><p class="x_x_MsoNormal">&nbsp;</p></div><p class="x_x_MsoNormal" style="margin-bottom:12.0pt">&nbsp;</p><div><div><div><table class="x_x_MsoNormalTable" border="0" cellspacing="0" cellpadding="0" width="100%" style="width:100.0%; border-collapse:collapse"><tbody><tr><td valign="top" style="padding:0in 0in 0in 0in"><div id="x_x_x_m_-2133782176778141572hs_cos_wrapper_main"><div id="x_x_x_m_-2133782176778141572section_1663686610065"><div><div id="x_x_x_m_-2133782176778141572column_1663686610065_0"><div id="x_x_x_m_-2133782176778141572hs_cos_wrapper_module_16636866100453"><table class="x_x_MsoNormalTable" border="0" cellspacing="0" cellpadding="0" width="100%" style="width:100.0%; border-collapse:collapse"><tbody><tr><td valign="top" style="padding:7.5pt 15.0pt 7.5pt 15.0pt"><p class="x_x_MsoNormal" align="center" style="text-align:center"><span style="font-size:1.0pt; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; border:solid windowtext 1.0pt; padding:0in"><img width="560" height="560" id="x_x__x0000_i1034" alt="Image removed by sender. Sec 1 - Header banner - 700X200 (4)" data-outlook-trace="F:0|T:1" src="cid:~WRD0000.jpg" style="width:5.8333in; height:5.8333in"></span><span style="font-size:1.0pt; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30"></span></p></td></tr></tbody></table></div><table class="x_x_MsoNormalTable" border="0" cellspacing="0" cellpadding="0" width="100%" style="width:100.0%; border-collapse:collapse"><tbody><tr><td style="padding:7.5pt 15.0pt 7.5pt 15.0pt"><div id="x_x_x_m_-2133782176778141572hs_cos_wrapper_module_16636866744102"><div id="x_x_x_m_-2133782176778141572hs_cos_wrapper_module_16636866744102_"><blockquote style="margin-top:5.0pt; margin-bottom:5.0pt"><h2 style="margin:0in; line-height:150%"><span style="font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">Building a more equitable company, technology,&nbsp;and society</span></h2><p style="line-height:125%"><span style="font-size:12.0pt; line-height:125%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">&nbsp;</span></p><h2 style="margin:0in; line-height:150%"><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal">At </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">Ginkgo</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal">, we\'re </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">committed to</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal"> building a more </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">equitable</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal"> </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">company</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal">, </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">technology</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal">, and </span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30">society</span><span style="font-size:12.0pt; line-height:150%; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; font-weight:normal">. To fulfill <a href="https://cG1Zb04.na1.hubspotlinks.com/Ctc/DL+113/cG1Zb04/VX8B6T6Y-FC6W4ySygB21p1f_W8kTzPf4TF0rSN8_nRGw3q90pV1-WJV7CgFj8W63BHJd2tdJZYW8XNBNg6ZvjY0W14WCZG7C3FyqVr-jd_3CGl8NW6vfFWl6MdXPrW1kVmLS8RFDtqW2Lzxrk22sxbmW395jk87zVxP6W22JxHZ1cb-q7W4d_bWv1_Xs0DW3-Gmpw4Cvvk0N3k5R8yxy-s1W5XHVxQ2BS6xMW7_s1MP1XmTjLW1d5ZtX6P9459W8nKJZk3F4d5fW3h9Z801rKyknW6cnFWB2n0VDDW87G_BF3cw7mkW314Np041wbXXN1_pw8Q7w-g2W8V3J8G961YllW7McGYy2YbHdtW19xNDp3HjlwCW5bWnNf6JryqdW7qVqT-5m3ZmN3bgT1"><b><span style="color:#3574E3">this</span></b></a> commitment, we established the Cultivate Fellowship to combat the historical marginalization of Black students in STEM and to provide networking and support for Black students in these fields.</span></h2></blockquote></div></div></td></tr></tbody></table><div id="x_x_x_m_-2133782176778141572hs_cos_wrapper_module_16686338026521"><p class="x_x_MsoNormal" style="background:white"><span style="font-size:13.5pt; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; display:none">&nbsp;</span></p><table class="x_x_MsoNormalTable" border="0" cellspacing="0" cellpadding="0" width="100%" style="width:100.0%; border-collapse:collapse; border-spacing:0!important"><tbody><tr><td valign="top" style="padding:7.5pt 15.0pt 7.5pt 15.0pt; word-break:break-word"><p class="x_x_MsoNormal" align="center" style="text-align:center"><span style="font-size:1.0pt; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30; border:solid windowtext 1.0pt; padding:0in"><img border="0" width="560" height="560" id="x_x__x0000_i1033" alt="Image removed by sender. Sec 3 - 700X350 (1)" data-outlook-trace="F:0|T:1" src="cid:~WRD0000.jpg" style="width:5.8333in; height:5.8333in"></span><span style="font-size:1.0pt; font-family:&quot;Arial&quot;,sans-serif; color:#0B1F30"></span></p></td></tr></tbody></table></div><table class="x_x_MsoNormalTable" border="0" cellspacing="