//           '<html><head><meta http-equiv="Content-Type" content="text/html; charset=utf-8"><meta name="Generator" content="Microsoft Word 15 (filtered medium)"><style><!--@font-face{font-family:Wingdings}@font-face{font-family:"Cambria Math"}@font-face{font-family:Calibri}@font-face{font-family:"Calibri Light"}@font-face{font-family:"Open Sans"}p.MsoNormal, li.MsoNormal, div.MsoNormal{margin:0in;font-size:11.0pt;font-family:"Calibri",sans-serif}a:link, span.MsoHyperlink{color:#0563C1;text-decoration:underline}p.MsoListParagraph, li.MsoListParagraph, div.MsoListParagraph{margin-top:0in;margin-right:0in;margin-bottom:0in;margin-left:.5in;font-size:11.0pt;font-family:"Calibri",sans-serif}span.EmailStyle19{font-family:"Calibri",sans-serif;color:windowtext}.MsoChpDefault{font-size:10.0pt}@page WordSection1{margin:1.0in 1.0in 1.0in 1.0in}div.WordSection1{}ol{margin-bottom:0in}ul{margin-bottom:0in}--></style></head><body lang="EN-US" link="#0563C1" vlink="#954F72" style="word-wrap:break-word"><div class="WordSection1"><p class="MsoNormal"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#44546A">Dear NIIMBL eXperience alumni, </span></p><p class="MsoNormal"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#44546A">&nbsp;</span></p><p class="MsoNormal" style="margin-bottom:8.0pt; line-height:105%"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#44546A">I hope you are having a great </span><span style="font-family:&quot;Open Sans&quot;,sans-serif">spring<span style="color:#44546A"> semester! It is hard to believe it is </span>mid-January<span style="color:#44546A">. </span>I am writing to let you know that the deadline for the 2023 NIIMBL eXperience has been extended to February 10, 2023<span style="color:#44546A">. </span>I have attached a flyer about eXperience and would be indebted to you if you would share it on your social media and with classmates. <span style="color:#44546A">&nbsp;</span></span></p><p class="MsoNormal" style="margin-bottom:8.0pt; line-height:105%"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#44546A">For many of you, the NIIMBL eXperience was helpful in your career path, and we want to afford this opportunity to as many students as possible for the coming years. </span></p><p class="MsoNormal" style="line-height:150%"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#53575A">As a reminder, the NIIMBL eXperience is an all-expenses paid immersion program offers Black, Latinx, and Native American college students completing their freshman or sophomore years a chance to explore career possibilities in the biopharmaceutical industry through hands-on learning and interactions with industry professionals. Students will also take part in activities designed to help them build their professional skillsets as they begin their career journeys.&nbsp;For the first time, we are excited to partner with our members to offer three unique eXperiences this summer. </span></p><p class="MsoNormal" style="line-height:150%"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#53575A">&nbsp;</span></p><ul type="disc" style="margin-top:0in"><li class="MsoListParagraph" style="color:#53575A; margin-left:0in; line-height:150%"><span style="font-family:&quot;Open Sans&quot;,sans-serif">NIIMBL eXperience @ ACPHS (Hosted by Albany College of Pharmacy and Health Sciences in New York)</span></li></ul><ul type="disc" style="margin-top:0in"><li class="MsoNormal" style="color:#53575A; line-height:150%"><span style="font-family:&quot;Open Sans&quot;,sans-serif">NIIMBL eXperience @ BioKansas (Hosted by BioKansas in the Kansas and Missouri Region)</span></li><li class="MsoNormal" style="color:#53575A; line-height:150%"><span style="font-family:&quot;Open Sans&quot;,sans-serif">NIIMBL eXperience @ RaritanValleyCC (Hosted by Raritan Valley Community College in New Jersey)</span></li></ul><p class="MsoNormal" style="line-height:150%"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#53575A">&nbsp;</span></p><p class="MsoNormal"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#44546A">Students can apply at <a href="https://niimbl.force.com/s/niimbl-experience"><span style="color:#44546A">https://niimbl.force.com/s/niimbl-experience</span></a></span><span style="font-family:&quot;Open Sans&quot;,sans-serif">. <span style="color:#44546A"></span></span></p><p class="MsoNormal"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#44546A">&nbsp;</span></p><p class="MsoNormal"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#44546A">We truly appreciate your help in getting the word out about the NIIMBL eXperience. As NIIMBL eXperience </span><span style="font-family:&quot;Open Sans&quot;,sans-serif">alums<span style="color:#44546A">, you are truly </span>the <span style="color:#44546A">best spokespersons for the program!!!!!</span></span></p><p class="MsoNormal" style="margin-bottom:8.0pt; line-height:105%"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#44546A">&nbsp;</span></p><p class="MsoNormal"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#44546A">Kind regards, </span></p><p class="MsoNormal"><span style="font-family:&quot;Open Sans&quot;,sans-serif; color:#44546A">&nbsp;</span></p><p class="MsoNormal"><span style="color:#44546A">&nbsp;</span></p><p class="MsoNormal"><b><span style="font-family:&quot;Calibri Light&quot;,sans-serif; color:#1F497D">Kathie Young</span></b><b><span style="font-family:&quot;Calibri Light&quot;,sans-serif; color:#3B3838"></span></b></p><p class="MsoNormal"><span style="font-family:&quot;Calibri Light&quot;,sans-serif; color:#3B3838">Workforce Activities Committee Coordinator </span></p><p class="MsoNormal"><span style="font-family:&quot;Calibri Light&quot;,sans-serif; color:#3B3838">University of Delaware | <a href="niimbl.org">NIIMBL</a></span></p><p class="MsoNormal"><span style="font-family:&quot;Calibri Light&quot;,sans-serif; color:#3B3838">590 Avenue 1743</span></p><p class="MsoNormal"><span style="font-family:&quot;Calibri Light&quot;,sans-serif; color:#3B3838">Newark, DE 19713</span></p><p class="MsoNormal"><span style="font-family:&quot;Calibri Light&quot;,sans-serif; color:#3B3838">302.831.0878</span></p><p class="MsoNormal"><span style="font-family:&quot;Calibri Light&quot;,sans-serif; color:#1F497D"><a href="mailto:kathiey@udel.edu">kathiey@udel.edu</a> </span></p><p class="MsoNormal"><a href="NIIMBL.org"><span style="color:#1F497D; text-decoration:none"><img border="0" width="104" height="37" id="Picture_x0020_1" src="cid:image001.jpg@01D7E5E6.63D60C50" alt="The National Institute for Innovation in Manufacturing Biopharmaceuticals logo" style="width:1.0833in; height:.3819in"></span></a><a href="https://www.linkedin.com/company/niimbl-the-national-institute-for-innovation-in-manufacturing-biopharmaceuticals"><span style="color:#1F497D; text-decoration:none"><img border="0" width="32" height="32" id="Picture_x0020_2" src="cid:image002.png@01D7E5E6.63D60C50" alt="Linkedin Logo" style="width:.3333in; height:.3333in"></span></a><a href="https://twitter.com/niimbl?lang=en"><span style="color:#1F497D; text-decoration:none"><img border="0" width="32" height="35" id="Picture_x0020_3" src="cid:image003.png@01D7E5E6.63D60C50" alt="Twitter Logo" style="width:.3333in; height:.368in"></span></a><span style="font-family:&quot;Calibri Light&quot;,sans-serif; color:#1F497D"></span></p><p class="MsoNormal"><span style="font-size:12.0pt; color:#44546A">&nbsp;</span></p><p class="MsoNormal">&nbsp;</p><p class="MsoNormal">&nbsp;</p></div></body></html>',
